// frontend/src/pages/HomePage.js
import React from 'react';
import Hero from '../components/Hero';  // Hero Section component
import Reviews from '../components/Reviews';  // Reviews Section component
import Insights from '../components/Insights';  // Insights Section component
import CompatibleHomes from '../components/CompatibleHomes';  // Homes Section component
import Footer from '../components/Footer';  // Footer Section component

const HomePage = () => {
  return (
    <div>
      <Hero />
      <Reviews />
      <Insights />
      <CompatibleHomes />
      <Footer />
    </div>
  );
};

export default HomePage;
